Peking duck is the most famous dish in Beijing 😋
⠀
Peking duck (roasted duck) was one of the main dishes on the menu of the imperial court during the Ming Dynasty (1368–1644). The first restaurant specializing in baked duck opened in Beijing in 1416.
⠀
How is Peking duck eaten in China?
⠀
You need to take the tortilla in one hand, grab a slice of duck with chopsticks and dip it in plum sauce. Spread the sauce with this piece of duck, then add a few more duck slices, cucumber and green onions. Roll up the cake and eat with your hands 🙌🏻
